import React from 'react';
import ListGroup from 'react-bootstrap/ListGroup';

function AcctHistory(props) {
  const { history } = props;
  return (
    <ListGroup>
        <strong>History</strong>
      {history &&
        history.length > 0 &&
        history.map((item) => (<ListGroup.Item>
         <span>{history.buyerId === userInfo.user._}</span>
        </ListGroup.Item>))}
    </ListGroup>
  );
}

export default AcctHistory;
